import React, { useState } from 'react';
import { connect } from 'react-redux';
import Grid from '@mui/material/Grid';
import { useNavigate } from 'react-router-dom';
import { Avatar, Button, Paper, TextField, Typography } from '@mui/material';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import { Link } from 'react-router-dom';
import { createUser } from '../redux/actions/productActions';
import axios from 'axios';
import Alert from '@mui/material/Alert';

const RegisterPage = (props) => {
  const { createUser, history } = props;
  const navigate = useNavigate();
  const paperStyle = { padding: 20, height: '70vh', width: 320, margin: '120px auto' };
  const avatarStyle = { backgroundColor: '#32e232', margin: 'auto' };
  const buttonStyle = { margin: '8px 0' };
  const textFieldStyle = { marginBottom: '15px' };

  const [name, setName] = useState('');
  const [surname, setSurname] = useState('');
  const [email, setEmail] = useState('');
  const [tel, setTel] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [age, setAge] = useState('');
  const [kilo, setKilo] = useState('');
  const [height, setHeight] = useState('');
  const [amountofWater, setAmountofWater] = useState('');
  const [dailyMovementAmount, setDailyMovementAmount] = useState('');
  const [desiredDestination, setDesiredDestination] = useState('');

  const isFormCompleted =
    name !== '' &&
    surname !== '' &&
    email !== '' &&
    tel !== '' &&
    password !== '' &&
    age !== '' &&
    kilo !== '' &&
    height !== '' &&
    amountofWater !== '' &&
    dailyMovementAmount !== '' &&
    desiredDestination !== '';

  const createUserRegister = async () => {
    try {
      const resp = await axios.post('http://localhost:3001/userRegister', {
        uid: '',
        name: name,
        surname: surname,
        email: email,
        tel: tel,
        password: password,
        age: age,
        kilo: kilo,
        height: height,
        amountofWater: amountofWater,
        dailyMovementAmount: dailyMovementAmount,
        desiredDestination: desiredDestination,
      });

      createUser(resp.data);

      // Başarılı kayıt olduğunda login sayfasına yönlendirme
      navigate('/loginPage');
    } catch (error) {
      console.log('Error:', error);
      setError('Kayıt sırasında bir hata oluştu.');
    }
  };

  return (
    <Grid>
      <Paper elevation={10} style={paperStyle}>
        <Avatar style={avatarStyle}>
          <LockOutlinedIcon />
        </Avatar>
        <Typography variant="h5" align="center">
          Hoşgeldin! Hadi kayıt işlemini yapalım.
        </Typography>
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <Typography variant="h6">Kullanıcı Bilgileri</Typography>
            <TextField
              label="İsim"
              placeholder="İsim girin"
              fullWidth
              required
              style={textFieldStyle}
              color="secondary"
              value={name}
              onChange={(e) => setName(e.target.value)}
            />
            {/* Diğer kullanıcı bilgileri alanları */}
          </Grid>
          <Grid item xs={6}>
            <Typography variant="h6">Seni Biraz Tanıyalım</Typography>
            <TextField
              label="Yaş"
              placeholder="Yaşınızı girin"
              fullWidth
              required
              style={textFieldStyle}
              color="secondary"
              value={age}
              onChange={(e) => setAge(e.target.value)}
            />
            {/* Diğer tanıma alanları */}
          </Grid>
        </Grid>
        <FormControlLabel control={<Checkbox defaultChecked color="secondary" />} label="Beni hatırla" />
        {error && (
          <Alert severity="error" onClose={() => setError('')}>
            {error}
          </Alert>
        )}
        <Button
          type="submit"
          color="secondary"
          variant="contained"
          fullWidth
          style={buttonStyle}
          disabled={!isFormCompleted}
          onClick={createUserRegister}
        >
          KAYIT OL
        </Button>
        <Typography>
          Zaten bir hesabınız var mı?
          <Link to="/loginPage" color="secondary">
            Giriş Yapın
          </Link>
        </Typography>
      </Paper>
    </Grid>
  );
};

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {
  createUser,
};

export default connect(mapStateToProps, mapDispatchToProps)(RegisterPage);
